class Main extends Component{
    render(){
        return(
            <div className="container" style={{marginTop:"12em"}}>

            
            <div className="row">
            <header>Personal Details</header>
            
            <div className="form-parent">
            <div className="form col-sm-10">
                <h3 className="personalheading">Personal details</h3>
            </div>
         
            
            </div>
            </div>
            </div>
            )
    }
}
export default Main
